  \"\",\n\t\t\"description\": \"A refined earthquake focal mechanism catalog for southern
  Califiornia using the HASH method and locations derived from waveform cross-correlation.
  Each focal mechanism is obtained from grid searching for the best-fitting double-couple
  focal mechanism solution to both the P-wave first motion polarity records that were
  picked by network analysts, and the S/P amplitude ratios computed from three-component
  seismograms. This dataset includes around 179,000 focal mechanisms for earthquakes
  occurring 1981 through 2010 in southern California region. An updated dataset for
  2014 has been added below.n nReferencesn nYang, W., E. Hauksson and P. M. Shearer,
  Computing a large refined catalog of focal mechanisms for southern California (1981
  - 2010): Temporal Stability of the Style of Faulting, Bull. Seismol. Soc. Am., June
